import React from 'react';
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Redirect,
  Link
} from "react-router-dom";

import Parties from './parties/pages/Parties';
import MainNavigation from './shared/Navigation/MainNavigation';

import './App.css';


const App = () => {
  return (
    <React.Fragment>
      <Router>
          <MainNavigation />
      <Link to="/">Create Party</Link>
      </Router>
      <Parties />
    </React.Fragment>
  );
}

export default App;
